+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="F54B33894E679E80B52B73BC60CB21EE", NativeString="<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">From the catwalk to the boardwalk, make waves in summer style. \r\nThis offer will no longer be available as of September 15th '24 00:00 UTC, and may return in the future.</>\r\n\r\nThis pack contains: ", LocalizedStrings=(("ar","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">من الرصيف إلى التصييف، اترك انطباعًا مدهشًا بأناقة الصيف. لن يكون هذا العرض متاحًا اعتبارًا من 15 سبتمبر 2024 الساعة 3:00 صباحًا (بتوقيت الرياض)، وقد يعود في المستقبل.</>\r\n\r\nتتضمن هذه الحزمة:"),("en","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">From the catwalk to the boardwalk, make waves in summer style. This offer will no longer be available as of September 15th '24 00:00 UTC, and may return in the future.</>\r\n\r\nThis pack contains: "),("de","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Vom Laufsteg auf den Bootssteg – schlage Wellen im Sommerstil. Dieses Angebot wird ab dem 15. September 2024 um 02:00 Uhr MESZ nicht mehr verfügbar sein, es kann aber in Zukunft wiederkehren.</>\r\n\r\nDieses Paket enthält:"),("es","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">De la pasarela al paseo marítimo. Disfruta de las olas con estilo veraniego. Esta oferta dejará de estar disponible el 15 de septiembre de 2024 a las 02:00 CEST y es posible que vuelva en un futuro.</>\r\n\r\nEste pack contiene:"),("es-419","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">De la pasarela a la costa, haz olas con un estilo veraniego. Esta oferta dejará de estar disponible el 15 de septiembre a las 18:00 MX y 21:00 AR, pero puede que vuelva en el futuro.</>\r\n\r\nEste paquete contiene:"),("fr","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Cet été, défilez avec style le long des promenades du bord de mer. Cette offre ne sera plus disponible à compter du 15 septembre 2024 à 2h (CEST) et pourrait revenir ultérieurement.</>\r\n\r\nCe pack contient:"),("it","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Dalle passerelle al lungomare, cavalca l'onda dell'estate. Questa offerta non sarà più disponibile a partire dalle ore 00:00 UTC del 15 settembre 2024, ma potrebbe tornare in futuro.</>\r\n\r\nQuesto pacchetto contiene:"),("ja","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">ランウェイから遊歩道まで、夏のスタイルでウェーブを巻き起こそう。本オファーは日本時間の2024年9月15日午前9時に提供を終了します。オファーの提供は後日再開する場合があります。</>\r\n\r\n本パックの内容:"),("ko","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">패션쇼에서 방금 나온 것 같은 멋진 여름 스타일로 해변가를 거닐어 보세요.이 혜택은 9월 15일 오전 9시(한국 시간)부터 이용할 수 없으며, 나중에 돌아올 수도 있습니다.</>\r\n\r\n구성품:"),("pl","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Przenieś się z wybiegu na molo i narób fal w letnim stylu. Oferta przestanie obowiązywać 15 września 2024 r. o godz. 00:00 czasu UTC, lecz może powrócić w przyszłości.</>\r\n\r\nPakiet zawiera:"),("pt-BR","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Das passarelas para o calçadão, cause impacto no estilo do verão. Esta oferta não estará mais disponível a partir de 15 de setembro de 2024, às 21h (BRT), mas pode retornar futuramente.</>\r\n\r\nEste pacote contém:"),("ru","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">С модного показа — и сразу на пляж, становиться законодателями летней моды! Это предложение будет доступно до 15 сентября 2024 г., 3:00 по московскому времени, однако оно может вернуться в будущем.</>\r\n\r\nНабор содержит:"),("tr","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">Podyumdan iskeleye geçiş yaparak yaz dalgalarına kafa tut. 15 Eylül 2024 TSİ 03.00 itibarıyla bu teklif oyundan kalkacak ama gelecekte tekrar dönebilir.</>\r\n\r\nPaket şunları içerir:"),("zh-hans","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">从T台到木板路，在夏日风格中掀起波澜。自UTC时间2024年9月15日00:00起，此商品将不再出售，但可能在以后回归。</>\r\n\r\n该组合包包含：")))
