+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="3010C4214988215A034EAEB6DF5A1D72", NativeString="Need <emphasis>Animal Treats</>? Cook more at the <emphasis>Grill</>. All you need is some <emphasis>Corn</> and <emphasis>Vines</>.", LocalizedStrings=(("ar","أتحتاج إلى <emphasis>طعام الحيوانات</>؟ قم بطهيها على <emphasis>الشواية</>. كل ما تحتاج إليه هو <emphasis>الجذوع</>."),("en","Need <emphasis>Animal Treats</>? Cook more at the <emphasis>Grill</>. All you need are <emphasis>Vines</>."),("de","Brauchst du <emphasis>Tierfutter</>? Du kannst mehr am <emphasis>Grill</> herstellen. Du brauchst nur <emphasis>Ranken</>."),("es","¿Necesitas <emphasis>chucherías para animales</>? Cocina más en la <emphasis>parrilla</>. Solo te hace falta <emphasis>fibra vegetal</>."),("es-419","¿Quieres <emphasis>bocaditos de animales</>? Cocina más en la <emphasis>parrilla</>. Solo necesitas <emphasis>enredaderas</>."),("fr","Vous avez besoin de <emphasis>friandises pour animaux</> supplémentaires ? Cuisinez-en d'autres avec le <emphasis>grill</> en utilisant du <emphasis>lierre</>."),("it","Ti servono <emphasis>spuntini per animali</>? Preparane altri sul <emphasis>grill</>. Avrai solo bisogno di <emphasis>piante rampicanti</>."),("ja","<emphasis>動物用オヤツ</>が必要？ <emphasis>グリル</>で作れるよ。必要なのは<emphasis>ツタ</>だけだよ。"),("ko","<emphasis>동물 간식</>이 필요하세요? <emphasis>그릴</>에서 더 만들어 보세요. <emphasis>덩굴</>만 있으면 된답니다."),("pl","Potrzebujesz <emphasis>przysmaków dla zwierząt</>? Możesz je przyrządzić przy <emphasis>grillu</>, o ile masz <emphasis>pnącza</>."),("pt-BR","Precisa de <emphasis>Petiscos</>? Você pode preparar mais na <emphasis>Grelha</>. Só vai precisar de <emphasis>Vinhas</>."),("ru","Нужны <emphasis>лакомства для животных</>? Их можно приготовить на <emphasis>гриле</> из <emphasis>лиан</>."),("tr","<emphasis>Hayvan Yiyeceği</> mi lazım? <emphasis>Izgarada</> daha fazlasını pişirebilirsin. Tek ihtiyacın olan biraz <emphasis>sarmaşık</>."),("zh-Hans","需要<emphasis>动物零食</>？可以在<emphasis>烧烤架</>上制作更多。只要使用<emphasis>藤蔓</>就行了。")))
