+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="0F8DB0B44D8711B746EF5189A27D4FF6", NativeString="TBD", LocalizedStrings=(("ar","تتضمن سيارة وبدائل للسيارة وملصقات قابلة للتخصيص! عناصر هذه الحزمة مقتصرة على هيكل سيارة Fast & Furious Nissan Skyline. ستملأ هذه السيارة خانة السيارة الرياضية في تجارب Fortnite ذات الصلة."),("en","Includes car, car variants, and customizable decals! Items in this bundle are restricted to the Fast & Furious Nissan Skyline car body. This Car will fill the Sports Car slot in relevant Fortnite experiences."),("de","Enthält ein Auto, Autovarianten und anpassbare Aufkleber! Die Gegenstände in diesem Paket sind auf die Karosserie „Fast & Furious Nissan Skyline“ beschränkt. Dieses Auto belegt in relevanten Fortnite-Erlebnissen den Sportwagen-Slot."),("es","Incluye coche, variantes de coche y calcomanías personalizables. Los objetos de este lote solo están disponibles para la carrocería del Nissan Skyline de Fast & Furious. Este vehículo ocupará el espacio del coche deportivo en las experiencias de Fortnite pertinentes."),("es-419","¡Incluye un auto, variantes de auto y calcomanías personalizables! Los objetos de este lote solo están disponibles para la carrocería Nissan Skyline de Fast & Furious. Este auto llenará el espacio de auto deportivo en las experiencias de Fortnite pertinentes."),("fr","Comprend un véhicule et des stickers personnalisables ! Les objets de ce pack ne fonctionnent que sur le châssis Fast & Furious Nissan Skyline. Cette voiture sera placée dans l'emplacement Voiture de sport des expériences de Fortnite concernées."),("it","Include l'auto, le varianti e gli adesivi personalizzabili! Gli oggetti di questo bundle sono limitati alla carrozzeria Nissan Skyline Fast & Furious. Questa auto occuperà lo slot Auto sportiva nelle esperienze di Fortnite del caso."),("ja","マシン、マシンのバリエーション、カスタマイズ可能なデカールを収録！ このバンドル内のアイテムは、マシンのボディ「Fast & Furious Nissan Skyline」に限定されています。このマシンは、対応しているフォートナイトの体験においてスポーツカーとして使用できます。"),("ko","차량, 차량 추가 스타일, 커스터마이징 가능한 데칼 포함! 이 번들의 아이템은 Fast & Furious Nissan Skyline 차체에만 사용할 수 있습니다. 이 차량은 관련 포트나이트 경험에서 스포츠카 슬롯에 할당됩니다."),("pl","Zawiera samochód, warianty samochodu i konfigurowalne wzory! Elementy tego zestawu można wykorzystać tylko z karoserią Fast & Furious Nissan Skyline. Ten samochód znajdzie się w polu samochodu sportowego we wszystkich odpowiednich przygodach Fortnite."),("pt-BR","Inclui carro, variantes do carro e Adesivos personalizados! Os itens deste pacote são restritos ao Chassi Fast & Furious Nissan Skyline. Este Carro preencherá o espaço de Carro Esportivo nas experiências Fortnite relevantes."),("ru","Включает машину, варианты внешнего вида машины и настраиваемые декали! Предметы из этого комплекта совместимы только с кузовом Fast & Furious Nissan Skyline. Эта машина будет занимать ячейку спортивного автомобиля в соответствующих режимах Fortnite."),("tr","Araba, araba çeşitleri ve özelleştirilebilir çıkartmalar içerir! Bu paketteki eşyaları yalnızca Fast & Furious Nissan Skyline araba gövdesiyle kullanabilirsin. Bu araba uygun Fortnite deneyimlerinde spor araba yuvasını doldurur."),("zh-hans","包括车辆，变体车型以及可自定义的贴花！此同捆包中的物品仅可用于速度与激情日产天际线车体。在Fortnite相关活动中，此车辆会填充运动跑车栏位。")))
